import React from 'react';
import axios from 'axios';

import {url} from '../App';

function Profile(){

  return(
    <div className ='card'>
      <div>
        {JSON.parse(localStorage.getItem("user"))} (@{JSON.parse(localStorage.getItem("user"))})
      </div>
      <div>
        Biography
      </div>
      <div>
        {JSON.parse(localStorage.getItem("bio"))}
      </div>
    </div>
  )
}

export default Profile;
